import { PubSub } from 'apollo-server';
import { joinFrom } from './../util/joinFrom';
import { ApolloDatabaseAnnotation, SubscriptionTypes } from './../resolvers';
import { Document } from './Document';
import { User } from './User';
import { Mention } from './Mention';
import { NewAnnotationInput, Annotation as ApolloAnnotation, NewMentionInput } from './../../../../types/resolvers-types';
import { Base } from './Base';
import { AnnotationMember } from './AnnotationMember';
import { Context } from '../resolvers';
import { createEntity } from '../entity';
import { Actions, Roles, AuthMethod, AuthorizeFunction } from '../util/permission';
import logger, { Tags } from '../../../../shared/log/logger';
import { throwError } from '../../../../shared/errors';
import { TIMESTAMP } from './../util/timestamps';
import { RequestedFields } from '../util/getRequestedFields';

export type AnnotationPublishEventOptions = {
  markedAsRead?: boolean;
  onlyFireForUserId?: string;
}

export type MarkAsReadReturnResult = {
  updatedMember: AnnotationMember,
  markedAsRead: boolean
}

export class Annotation extends Base<
  ApolloDatabaseAnnotation,
  ApolloAnnotation,
  {
    membership: AnnotationMember;
    author: User | null;
    mentions: Mention[];
  }
> {
  constructor(annotation: ApolloDatabaseAnnotation, userId: string, from: string, context: Context, skipMembership = false) {
    super({
      name: 'Annotation',
      entity: annotation,
      from,
      context,
      getters: {
        membership: async () => {
          if(!annotation.authorId || skipMembership) return null;
          const member = (await context.resolvers.Query.annotationMembers({ annotationId: annotation.id, userId }))?.[0];
          if(!member) return null;
          return new AnnotationMember(member, joinFrom(from, 'getters.membership'), context);
        },
        author: async () => {
          if (!annotation.authorId) return null;
          const entity = await context.resolvers.Query.user(annotation.authorId);
          const user = new User(entity, joinFrom(from, `getters.author(${annotation.authorId})`), context);
          return user;
        },
        mentions: async () => {
          const mentions = await context.resolvers.Query.mentions({ annotationId: this.id});
          return mentions.map( m => new Mention(m, joinFrom(from, 'getters.mentions'), context));   
        }
      },
      authorize: async (action: Actions, context: Context) => {
        const permission = context.permissionSetting.annotation;
        if (action === 'read') {
          const allow = await this.checkPermission(permission.read, context);
          if (!allow) {
            const errMsg = 'Permission denied: User does not have the permission to view the annotation.';
            throwError('Annotation.authorize', errMsg);
          }
        }
        if (action === 'add') {
          if(this.getEntity().authorId){
            const allow = await this.checkPermission(permission.add, context);
            if (!allow) {
              const errMsg = 'Permission denied: User does not have the permission to add annotations.';
              throwError('Annotation.authorize', errMsg);
            }
          }
        }
        if (action === 'edit') {
          const allow = await this.checkPermission(permission.edit, context);
          if (!allow) {
            const errMsg = 'Permission denied: User does not have the permission to edit the annotation.';
            throwError('Annotation.authorize', errMsg);
          }
        }
        if (action === 'delete') {
          const allow = await this.checkPermission(permission.delete, context);
          if (!allow) {
            const errMsg = 'Permission denied: User does not have the permission to delete the annotation.';
            throwError('Annotation.authorize', errMsg);
          }
        }
      },
      update: async (entity) => await context.resolvers.Mutation.editAnnotation(entity.id, entity),
      remove: async (id) => {
        const memberships = await context.resolvers.Query.annotationMembers({ annotationId:  this.id });
        await Promise.all(memberships.map(async (m) => await context.resolvers.Mutation.deleteAnnotationMember(m.id)));
        const mentions = await context.resolvers.Query.mentions({ annotationId: this.id});
        await Promise.all(mentions.map(async mention => await context.resolvers.Mutation.deleteMention(mention.id)));
        return await context.resolvers.Mutation.deleteAnnotation(id);
      }
    });
  }

  getAnnotationForUser(userId: string, requestedFields: RequestedFields, skipMembership = false) {
    const entity = this.getEntity();
    return new Annotation(entity, userId, 'annotation.getAnnotationForUser', { ...this.context, requestedFields }, skipMembership);
  }

  async publishEvent(pubsub: PubSub, action: 'INVITE' | 'EDIT' | 'ADD' | 'DELETE', options: AnnotationPublishEventOptions = {}) {
    const docId = await this.get('documentId');
    const authorId = await this.get('authorId');
    const doc = (await this.context.resolvers.Query.documents({ ids: [docId] }))?.[0];
    const isDocumentPublic = doc?.isPublic;
    const { connectedUsers } = this.context;
    //property name in subscriptionFields should be identical with the operation name in packages/collab-client/src/graphql/subscriptions/annotationChanged.ts
    const annotationChangedRequestedFields = this.context.subscriptionFields['OnAnnotationChanged']; 
    const annots = [];
    const mentions = [];
    if(action === 'ADD' || action === 'DELETE') {
      mentions.push(...(await this.getCalculated('mentions')));
    }
    const { markedAsRead, onlyFireForUserId: userId } = options;

    const pushToAnnots = async (userId) => {
      const skipMembership = action === 'ADD' && userId !== authorId;
      annots.push({
        annot: await this.getAnnotationForUser(
          userId,
          annotationChangedRequestedFields,
          skipMembership
        ),
        userId,
      });
    }
    if(userId){
      await pushToAnnots(userId);
    } else if (isDocumentPublic) {
      //fire for all connected users who are viewing this document
      const connectedDocUsers = connectedUsers.getConnectedUsersForDocument(docId);
      for (const { userId } of connectedDocUsers) {
        await pushToAnnots(userId);
      }
    } else { //fire for all connected users who are doc member
      const members = await this.context.resolvers.Query.documentMembers({ documentId: docId });
      const connectedUsers = await this.context.connectedUsers;
      const keys = Array.from(connectedUsers.getAllConnectedUsers());
      for (let i = 0; i < members.length; i++) {
        const userId = members[i].userId;
        if (keys.includes(userId)) {
          // if we are adding an annotation, there will not be a membership for anyone except the author
          // we can optimize this by not fetching annot members in that scenario
         await pushToAnnots(userId);
        }
      }
    }

    const p = annots.map(async ({ annot, userId }) => {
      const mentionedCurrentUser = userId !== authorId && !!mentions.find(mention => mention.getEntity().userId === userId);
      pubsub.publish(SubscriptionTypes.ANNOTATION_CHANGED, {
        annotationChanged: {
          annotation: await annot.resolveAsEntity(),
          action,
          document: doc,
          markedAsRead,
          mentionedCurrentUser
        },
        userId
      });
    })

    await Promise.all(p);

    if(action === 'ADD' || action === 'DELETE') { //publish event for mentions in this annotation
      await Promise.all(mentions.map(mention => mention.publishEvent(pubsub, action)));
    }
  }

  async checkPermission(authMethods: Array<AuthMethod> | AuthMethod, context: Context): Promise<boolean> {
    if (!Array.isArray(authMethods)) {
      authMethods = [authMethods];
    }

    //skip permission check if its parent is deleted
    const parentId = this.getEntity().inReplyTo;
    if (parentId) {
      const result = await context.resolvers.Query.annotations({
        ids: [parentId]
      });
      const parent = result?.[0];
      if(!parent) {
        return true;
      }
    }

    let allowed = false;
    const currentUserId = context.user?.id;
    const currentUser = await this.context.resolvers.Query.user(currentUserId);
    const docId = this.getEntity().documentId;
    const document = (await this.context.resolvers.Query.documents({ ids: [docId] }))?.[0];
    for (let i = 0; i < authMethods.length; i++) {
      //OR op on all auth methods
      const isAnnotAuthor = this.getEntity().authorId === currentUser.id;
      const authMethod = authMethods[i];
      if (typeof authMethod === 'string') {
        if (authMethod === Roles.ANY) {
          return true;
        }
        if (!currentUser) {
          allowed ||= false;
          continue;
        }
        if (authMethod === Roles.DOCUMENT_AUTHOR) {
          allowed ||= document.authorId === currentUser.id;
        }
        if (authMethod === Roles.DOCUMENT_MEMBER) {
          const d = new Document(document, currentUserId, 'Annotation.checkPermission', context);
          const currentUserDocMember = await d.getUserMembership(currentUser.id);
          allowed ||= !!currentUserDocMember;
        }
        if (authMethod === Roles.ANNOTATION_AUTHOR) {
          //allow parent annotation author to delete replies
          const parentId = this.getEntity().inReplyTo;
          if(parentId) {
            const parent = await Annotation.buildFromId(parentId, currentUserId, 'Annotation.checkPermission', context);
            allowed ||= parent.getEntity().authorId === currentUserId;
          }
          allowed ||= isAnnotAuthor;
        }
      } else {
        const authFunction = authMethod as AuthorizeFunction;
        allowed ||= await authFunction(this.getEntity(), currentUser);
      }
    }
    return allowed;
  }

  async addMember(user: { id: string }) {
    const now = TIMESTAMP;
    const docId = await this.get('documentId');
    const createdAt = await this.get('createdAt');
    const member = await AnnotationMember.create(user.id, docId, this.id, now, createdAt, joinFrom(this.from, 'addMember'), this.context);
    return member;
  }

  async addMention(userId: string){
    const { id: annotationId, documentId } = this.getEntity();
    const entity = await createEntity({
      userId,
      annotationId,
      documentId
    }) as unknown as NewMentionInput;
    const mention = await Mention.create(entity, joinFrom(this.from, 'addMention'), this.context);
    // publish event in this.publishEvent to make sure the event for annotation is published before the event for mention
    // to store annotation info for notification of mentions
    return mention;
  }

  async markAsRead(userId): Promise<MarkAsReadReturnResult> {
    let updatedMember: AnnotationMember;
    let markedAsRead = false;
    const member = await this.getCalculated('membership');
    if(!member){
      //create new member
      updatedMember = await this.addMember({ id: userId });
      this.setCalculated('membership', updatedMember);
      const authorId = await this.get('authorId');

      // only mark annotation as read if there is an author
      // we don't want to mark default annotations as read
      markedAsRead = !!authorId;
    } else {
      //update current member
      await member.setMultiple({
        lastRead: TIMESTAMP
      });
      await member.save();
      updatedMember = member;
    }
    return {
      updatedMember,
      markedAsRead
    }
  }

  static async buildFromId(id: string, userId: string, from: string, context: Context) {
    const annot = (await context.resolvers.Query.annotations({ ids: [id] }))?.[0];
    if(!annot) return null;
    const annotObject = new Annotation(annot, userId, joinFrom(from, `Annotation.buildFromId(${id})`), context);
    return annotObject;
  }

  /**
   * Creates a new annotation and saves it in the database
   */
  static async create(input: NewAnnotationInput, from: string, context: Context): Promise<Annotation> {
    const { user } = context;

    const newEntity = await createEntity(input);
    logger.debug(`New Annotation Entity created:`, { tag: Tags.ENTITY, meta: newEntity });

    const annot = new Annotation(newEntity, user.id, joinFrom(from, 'Annotation.create'), context);

    //check permission
    await annot.getAuthFunction()(Actions.ADD, context);
    await context.resolvers.Mutation.addAnnotation(newEntity);

    // add annotation member just for the author
    await annot.addMember(user);

    //add mentions in this new annotation
    const p = (input.mentionedUserIds || []).map( userId => annot.addMention(userId));
    await Promise.all(p);

    return annot;
  }
}
